import React from 'react';
import MoviePoster from '../MoviePosters/MovePoster/MoviePoster';
import MoviePosters from '../MoviePosters/MoviePosters';
import classes from './Layout.module.css'

const layout = props => {

    movies = {
        movie1: {
            title: 'Interstellar',
            image: 'http://image.tmdb.org/t/p/w185//nBNZadXqJSdt05SHLqgT0HuC5Gm.jpg'
        },
        movie2: {
            title: 'Avengers',
            image: 'https://upload.wikimedia.org/wikipedia/en/f/f9/TheAvengers2012Poster.jpg'

        }
    };

    return (
        <div>
            <div className={classes.Toolbar}><strong>Latest Movies</strong></div>
            <MoviePosters movies={movies}/>
        </div>
    );
};

export default layout;
